import React from 'react';

import Input from '../../shared/components/FormElement/Input';
import { VALIDATOR_EMAIL ,VALIDATOR_MINLENGTH} from '../../shared/components/util/validators';
import Button from '../../shared/components/FormElement/Button';
import { useForm } from '../../shared/components/hooks/form-hook'
import '../../places/pages/PlaceForrm.css';

const Authenticate = () => {

    const [ formState, inputHandler ]= useForm({
        email: {
          value: '',
          isValid: false
        },
        password: {
          value: '',
          isValid: false
        },
    
      },false);

      const authenticateSubmitHandler = event =>{
          event.preventDefault();
          console.log(formState.inputs);
      }

    return (
      <form className="place-form" onSubmit={authenticateSubmitHandler}>
        <Input
          id="email"
          element="input"
          type="text"
          label="Email"
          validators={[VALIDATOR_EMAIL()]}
          errortext="please enter valid email-id"
          onInput={inputHandler}
        />
        <Input
          id="password"
          element="input"
          type="text"
          label="Password"
          validators={[VALIDATOR_MINLENGTH(6)]}
          errortext="please enter at least 6 charactors"
          onInput={inputHandler}
        />
        <Button type="submit" disabled={!formState.isValid}>SIGN IN</Button>
      </form>
    );
};

export default Authenticate;
